export type TConnectionEvent =
	| 'init'
	| 'connected'
	| 'open'
	| 'open_error'
	| 'register_error'
	| 'disconnected'
	| 'error'
	| 'approved'
	| 'rejected'
	| 'display_uri';

export type InternalSocketEventType = 'error' | 'response' | 'error-topic' | 'topic' | 'uri';

export type InternalSocketEvent = {
	type: InternalSocketEventType;
	payload: string[] | string | object | unknown;
};
